断熱&UVカット！コンパクトサンシェード<br><br>高密度生地を採用。熱もUVも大幅カット。しっかり遮光タイプ。<br>パッと広がり、クルッと収納。吸盤式なので、まぶしいところにピッタリ簡単取付け。<br>吸盤が2個なので、ズレずにしっかり取付け。プライバシーの保護に。<br>N-ボックス、タント、スペーシアなどの軽トールワゴンの後部座席のサイドガラスに適したサイズです。<br>※ワイヤーフレームにカバーチューブを被せる改良を施しています。<br><br><br>●仕様<br>サイズ：縦約46cm x横約55cm<br>数量：シェード2枚入り、吸盤2個入り<br><br>メーカー品番：B89-325<br>メーカー：ミラリード<style type="text/css">
